class Solution {
public:
    long long maxSum(vector<int>& nums, int m, int k) {
        long long maxSum = 0;
        for (int i = 0; i <= nums.size() - k; ++i) {
            unordered_map<int, int> count;
            long long sum = 0;
            for (int j = i; j < i + k; ++j) {
                count[nums[j]]++;
                sum += nums[j];
            }
            if (count.size() >= m) {
                maxSum = max(maxSum, sum);
            }
        }
        return maxSum;
    }
};
